import {Component} from 'react';
import '../Style/App.css';

class Home extends Component{

  state={
    animes:[]
  }

  render(){
    const {animes} = this.state;
    return (
     <div className="Anime">
       {
         animes.map(anime =>(
           <div key={anime.id}>
             <img src="{anime.data.picture}" alt="{anime.data.title}" />
           </div>
         ))
       }

     </div>
    );
  
  }
  }

export default Home;
